exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.xcmfu.com/${bid.idPrefix()}/${bid}.html`;return parseCatalog(url,[/id="chapterList">(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)*)/,/<a href="(?<url>[^"]+)">(?<name>[^<]+)/g],{clientOptions:{...(options&&options.clientOptions)}})};